        and deduct_rate = #{deductRate}


        and order_origin = #{orderOrigin}


        and photo = #{photo}


        and gpy_photo = #{gpyPhoto}


        and signature_photo = #{signaturePhoto}


        and material = #{material}


        and tare_quantity = #{tareQuantity}


        and rough_quantity = #{roughQuantity}


        and is_red = #{isRed}


